import React, { Component } from 'react';

class App extends Component{
    constructor(props){
        super(props);

        this.onSubmit = this.onSubmit.bind(this)
    }

    onSubmit(e){
        e.preventDefault();
        console.log(this.input.value);

    }
    render(){
        const list = [
            'Itme 1',
            'Item 2',
            'Item 3'
        ]
        return (
            <div className= "App">
                <h1>
                    {
                        list.map(item => {
                            return (
                                <div key={item} onMouseEnter={this.OnMouseEnter}> {item}</div>
                             )
                        })
                    }
                    </h1>
                    <form onSubmit={ this.onSubmit}>
                         <input onChange={this.onChange} ref={input => this.input = this.input = input} />
                    </form>
            </div>
        )
    }
}

export default App;
